import React from "react";
import footerlogo from "../assets/Logo.png"

function Footer(){
    return(
      <div className="footer-container">
      <div className="footer-section1">
        <img src={footerlogo} className="footer-logo"/>
        <p className="section1-text">BikePulse is a dynamic software development team with a global presence through offices in Canada and the UAE. Since 2012, we have been at the forefront of delivering cutting-edge web and mobile solutions, providing customized software to clients worldwide. Our commitment to innovation and quality positions BikePulse Techware Lab as a trusted partner, seamlessly merging technology with the excitement of biking.</p>
      </div>


      </div>
    );

}
export default Footer;
